import React from 'react';
import style from './style.module.css';

export const Sale = () => {
    return (
        <div className={style.container}>
            <div className={style.sale}></div>
            <h1>Sale</h1>
            <h2>New season</h2>
            <button>Sale</button>

        </div>
    );
    }
